params = {'objective': 'regression', 'metric': 'rmse', 'verbose': -1, 'nthread': 4,
          'learning_rate': 0.28, 'num_leaves': 32, 'max_depth': 8, 'min_data': 20}

train_data = lgb.Dataset(tx, label=ty)
